Starring	Tanya Tate, Cherie DeVille, Katerina Kay, Taylor Whyte, Bailey Bae, Staci Carr, Scarlett Red

Mrs. Tate has always been the most supportive parent on the block, even if she has no real daughters of her own. A devoted soccer mom, president of the home school association, and blue ribbon award winning baker, she is always there to help her step=daughters and their friends whenever they need support. So, when Scarlet shows up one day looking for advice, Mrs. Tate welcomes the young neighbor inside and shows her AND step-daughter Bailey just how to behave like real women. Mommysgirl.com presents Eat My Muffin and Other Stories, starring Tanya Tate, Scarlet Red, Bailey Bae, and Katerina Kay. Watch Mrs. Tate as she coaches Scarlet and Bailey how to please each other before turning her eye on her other step-daughter, Katerina. This anthology also features Cherie Deville as a horny mom who puts all the young women in her neighborhood to work... and play!
